import React, { useState, useEffect } from 'react';
import Navbar from "./components/navbar";
import HomeHero from "./components/HomeHero";
import MarketplaceSquares from "./components/MarketplaceSquares";

function Home(props) {
  const [cargoListings, setCargoListings] = useState([]);

  useEffect(() => {
    // Fetch cargo listings from an API or database
    // Replace the following with your actual API call
    fetch('https://api.example.com/cargo-listings')
      .then((response) => response.json())
      .then((data) => {
        setCargoListings(data);
      })
      .catch((error) => {
        console.error('Error fetching cargo listings:', error);
      });
  }, []);

  return (
    <div>
      <Navbar />
      <HomeHero />
      <MarketplaceSquares cargoListings={cargoListings} />
    </div>
  );
}

export default Home;
